import React from 'react';

interface Interface {

}

const Index: React.FC<Interface> = (props) => {

    return (
        <div>
            blog
        </div>
    );
}

export const getStaticProps = async () => {
    const res = await fetch('https://.../posts')
    const posts: Post[] = await res.json()

    return {
        props: {
            posts,
        },
    }
}

export default Index
